  Lemma a1_exist : forall (A B : Point) , {l : Line | Incid A l /\ Incid B l}.
  Proof. exact a1_exist. Qed.

  Lemma a2_exist : forall (l1 l2 : Line), {A : Point | Incid A l1 /\ Incid A l2}.
  Proof. exact a2_exist. Qed.

  Lemma uniqueness : forall (A B : Point)(l1 l2 : Line),
      Incid A l1 -> Incid B l1  -> Incid A l2 -> Incid B l2 -> A = B \/ l1 = l2.
  Proof. exact uniqueness. Qed.

  Lemma a3_1 : forall l : Line,
      {A : Point & {B : Point & {C : Point |
           (~ A = B /\ ~ A = C /\ ~ B = C /\ Incid A l /\ Incid B l /\ Incid C l)}}}.
  Proof. exact a3_1. Qed.

  Lemma a3_2 : {l1 : Line & {l2 : Line | l1 <> l2}}.
  Proof. exact a3_2. Qed.

End hall9.


(*
Building an instance of a Desargues configuration and checking that the points 
alpha, beta and gamma do not lie on the same line
*)

Definition on_line := fun A B C l => Incid A l /\ Incid B l /\ Incid C l.
Definition collinear A B C :=  exists l, Incid A l /\ Incid B l /\ Incid C l.
Check O.

Definition desargues_hyps (O P Q R P' Q' R' alpha beta gamma:Point) ( lP lQ lR lPQ lPR lQR lP'Q' lP'R' lQ'R':Line) :=
((on_line P Q gamma lPQ) /\ (on_line P' Q' gamma lP'Q')) /\
((on_line P R beta lPR) /\ (on_line P' R' beta lP'R')) /\
((on_line Q R alpha lQR) /\ (on_line Q' R' alpha lQ'R')) /\
((on_line O P P' lP) /\ (on_line O Q Q' lQ) /\(on_line O R R' lR)) /\ 
~collinear O P Q /\  ~collinear O P R /\ ~collinear O Q R /\ 
~collinear P Q R /\ ~collinear P' Q' R' /\ ((P<>P')\/(Q<>Q')\/(R<>R')).

Definition desargues_concl (O P Q R P' Q' R' alpha beta gamma:Point) ( lP lQ lR lPQ lPR lQR lP'Q' lP'R' lQ'R':Line) :=
collinear alpha beta gamma.

Lemma not_line : ~collinear P82 P61 P24.
Proof.
  unfold collinear, Incid; intros [x [H1 [H2 H3]]]. destruct x;  discriminate.
Qed.

Lemma Desargues_hyps_hold_for_these_points :
  desargues_hyps P0 P1 P10 P11 P2 P31 P25 P82 P61 P24
    (l_from_points P0 P1) (l_from_points P0 P10) (l_from_points P0 P11)
    (l_from_points P1 P10) (l_from_points P1 P11) (l_from_points P10 P11)
    (l_from_points P2 P31) (l_from_points P2 P25) (l_from_points P31 P25).
intros.
unfold desargues_hyps,on_line, collinear, Incid in *; simpl in *.
repeat split.
intros [x [H1 [H2 H3]]]; destruct x; try discriminate.
intros [x [H1 [H2 H3]]]; destruct x; try discriminate.
intros [x [H1 [H2 H3]]]; destruct x; try discriminate.
intros [x [H1 [H2 H3]]]; destruct x; try discriminate.
intros [x [H1 [H2 H3]]]; destruct x; try discriminate.
left; discriminate.
Qed.

Theorem Desargues_does_not_hold : (forall (O P Q R P' Q' R' alpha beta gamma:Point)
                               (lP lQ lR lPQ lPR lQR lP'Q' lP'R' lQ'R':Line),
    desargues_hyps O P Q R P' Q' R' alpha beta gamma lP lQ lR lPQ lPR lQR lP'Q' lP'R' lQ'R' ->
    desargues_concl O P Q R P' Q' R' alpha beta gamma lP lQ lR lPQ lPR lQR lP'Q' lP'R' lQ'R') -> False.
Proof.
  intros.
  apply not_line.
  apply (H P0 P1 P10 P11 P2 P31 P25 P82 P61 P24
    (l_from_points P0 P1) (l_from_points P0 P10) (l_from_points P0 P11)
    (l_from_points P1 P10) (l_from_points P1 P11) (l_from_points P10 P11)
    (l_from_points P2 P31) (l_from_points P2 P25) (l_from_points P31 P25)).
apply Desargues_hyps_hold_for_these_points.
Qed.


